ANSWER:
 Gerbiamas Pranešėjau, 

Vilniaus miesto savivaldybės administracija gavo Jūsų  2022 m. spalio 10 d. Tvarkau miestą pranešimą (Savivaldybėje registruota 2022 m. spalio 10 d., reg. Nr. E938-7538/22(3.2.55E-AD24) dėl žemės sklypuose Mechanikų gatvėje, Vilniuje, pastatytų tvorų.
Pagal statybos techninį reglamentą STR 1.01.03:2017 „Statinių klasifikavimas“, patvirtintą Lietuvos Respublikos aplinkos ministro 2016 m. spalio 27 d. įsakymu Nr. D1-713 „Dėl statybos techninio reglamento STR 1.01.03:2017 „Statinių klasifikavimas“ patvirtinimo“ (toliau – STR 1.01.03:2017  ), įvairios užtvaros (tvoros, aptvarai, diendaržiai, taip pat ir voljerai), kurių aukštis 1–2 m, priskirtinos I grupės nesudėtingiesiems statiniams, o užtvaros, kurių aukštis 2–5 m (aukštesnių kaip 2 m dalių akytumas ne mažesnis kaip 80 proc.), priskirtinos II grupės nesudėtingiesiems statiniams. 
Valstybinės teritorijų planavimo ir statybos inspekcijos prie Aplinkos ministerijos  (toliau – Inspekcija) nuostatų, patvirtintų Lietuvos Respublikos aplinkos ministro 2003 m. liepos 9 d. įsakymu Nr. 349 (2019 m. balandžio 1 d. įsakymo Nr. D1-190 redakcija) (toliau – Nuostatai), 2 punktas įtvirtina inspekcijos paskirtį pagal kompetenciją vykdyti teritorijų planavimo ir statybos valstybinę priežiūrą. Nuostatų 10.2 papunktis įpareigoja Inspekciją užtikrinti, kad statinių statyba būtų vykdoma teisėtai.
Dėl Jūsų minimos problemos prašome kreiptis į Inspekciją, kad pagal kompetenciją įvertintų Jūsų išdėstytas aplinkybes, atliktų tyrimą ir apie priimtus sprendimus informuotų Jus.
Pranešimus Inspekcijai galite pateikti:
-	telefonu Nr. (8 5) 272 1072 (įdiegtas automatinis atsakiklis). Vieno pranešimo, pateikto Pasitikėjimo linijos telefono numeriu (su įdiegtu automatiniu atsakikliu), maksimali trukmė yra 90 sekundžių;
-	Inspekcijos interneto svetainės skyriaus „Pasitikėjimo linija“ poskyryje „Elektroninė pranešimo forma“ užpildę nurodytą elektroninę formą;
-	išsiuntę paštu, adresu: A. Vienuolio g. 8, 01104 Vilnius;
-	per Inspekcijoje esančius asmenų aptarnavimo stendus.
